元</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">3.</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">采购需求：盐城市第一人民医院网络安全等级保护测评服务，详见第四章项目需求。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">4.</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">工期要求：网络安全等级保护现状分析工作需在公安部项目登记管理系统中登记审核通过后<span>30</span>天（工作日）内完成，出具《安全问题汇总及整改建议》；最终《信息系统安全等级保护测评报告》需在招标人完成安全建设整改后<span> 15</span>天（工作日）内提供。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">5.</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">质量要求：投标人须向招标人提供详细的测评材料、各种表单及结果报告。测评服务的范围、内容、形式、标准等应符合国家及行业的有关标准及规范要求。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">6.</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">质保期：一年。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">7.</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">本项目<u>不接受</u>联合体投标。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24.1pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><b><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">二、申请人的资格要求：</span></b></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">1.</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">满足《中华人民共和国政府采购法》第二十二条规定，并提供下列材料；</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">(1)</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">法人或者其他组织的营业执照等证明文件，自然人的身份证明；</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">(2)</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">上一年度的财务报表（成立不满一年不需提供）；</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">(3)</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">依法缴纳税收和社会保障资金的相关材料；</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">(4)</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">具备履行合同所必需的设备和专业技术能力的书面声明；</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">(5)</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">参加政府采购活动前<span>3</span>年内在经营活动中没有重大违法记录的书面声明；</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">2.</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">本项目的特定资格要求：</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">（<span>1</span>）须具有有效期内的公安部第三研究所认证发放的《网络安全等级测评与检测评估机构服务认证证书》。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">（<span>2</span>）项目负责人要求：投标人配备的服务人员须具备信息安全等级测评师资质，且项目负责人须为高级测评师。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">（<span>3</span>）未被“信用中国”网站（<span>www.creditchina.gov.cn</span>）列入失信被执行人、重大税收违法案件当事人名单、政府采购严重失信行为记录名单。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24.1pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><b><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">三、获取招标文件</span></b><b><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">时间</span></b></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">请符合上述资质条件的投标人携带单位介绍信到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2022</span>年<span>6 </span>月<span>24</span>日<span>8</span>时<span>30</span>分至<span>2022</span>年<span>6</span>月<span>29</span></span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">日<span>18</span>时。联系人：刘工，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt 21pt; text-align: justify; line-height: 1.5; text-indent: 0cm; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><b><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">四、</span></b><b><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">本项目采用<span>“</span>资格后审<span>”</span>，<span>“</span>综合评估法<span>”</span>。</span></b></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt 21pt; text-align: justify; line-height: 1.5; text-indent: 0cm; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">五、</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">投标申请人有违反《盐城市市场廉政准则规定（试行）》中规定情形的，招标人将拒绝投标报名。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt 21pt; text-align: justify; line-height: 1.5; text-indent: 0cm; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">六、</span><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">招投标监督管理机构及投诉电话：盐城市第一人民医院监督审查室，联系电话<span>0515-66696810</span>。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24.1pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><b><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">七、对本次招标提出询问，请按以下方式联系。</span></b></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24.1pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><b><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">1.</span></b><b><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">采购人信息</span></b></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">地<span>&nbsp;\r\n</span>址：人民南路<span>66</span>号</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 1.5; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"line-height: 1.5; font-family: 宋体; font-size: 12pt;\">联系人：张女士</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-