INSERT INTO `p8_admin_log` (`id`,`uid`,`system`,`module`,`action`,`iid`,`cid`,`site`,`username`,`title`,`url`,`ip`,`data`,`timestamp`) VALUES ('6420','0','cms','item','add','0','841','','宣传处','添加内容(前台) | 市医学会烧伤整形外科学分会学术年会我院整形烧伤科主任于海洲','/index.php/cms/item-list-category-841-page-5','172.16.1.2','array (\n  \'__referer\' => \'http://192.168.162.72/u.php/cms/item-add?model=article\',\n  \'cid\' => \'841\',\n  \'title\' => \'市医学会烧伤整形外科学分会学术年会我院整形烧伤科主任于海洲当选为盐城市医学会烧伤整形外科学分会主任委员\',\n  \'title_color\' => \'\',\n  \'html\' => \'1\',\n  \'author\' => \'\',\n  \'editer\' => \'\',\n  \'timestamp\' => \'\',\n  \'source\' => \'盐城市第一人民医院\',\n  \'keywords\' => \'\',\n  \'frame\' => \'\',\n  \'thumb_width\' => \'328\',\n  \'thumb_height\' => \'247\',\n  \'level_time\' => \'不选则永久有效\',\n  \'level\' => \'\',\n  \'summary\' => \'\',\n  \'sub_title\' => \'\',\n  \'verify_frame\' => \'\',\n  \'custom_a\' => \'\',\n  \'#field_content_posted\' => \'\',\n  \'field#\' => \n  array (\n    \'content\' => \'<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\\\'Calibri\\\',\\\'sans-serif\\\';text-indent:28.0pt;line-height:24.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">为促进烧伤整形外科学的发展，<span> 6</span>月<span>25</span>日在盐城举办的市医学会烧伤整形外科学分会学术年会暨适宜技术送教下基层第<span>156</span>期培训班中盐城市第一人民医院整形烧伤科主任于海洲当选为盐城市医学会烧伤整形外科学分会主任委员。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\\\'Calibri\\\',\\\'sans-serif\\\';text-indent:28.0pt;line-height:24.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">大会邀请了江苏省医学会副会长兼秘书长胡寅教授，中华医学会烧伤分会主任委员、江南大学附属医院吕国忠教授，江苏省医学会医学美学与美容分会主任委员、南京鼓楼医院谭谦教授，江苏省整形美容协会副会长、江苏省人民医院姚刚教授，江苏省医学会整形烧伤分会主任委员、南通大学附属医院张逸教授，江苏省医师协会烧伤分会会长苏州市立医院副院长孙炳伟教授，江苏省医学会医学美学与美容分会候任主任委员、苏北人民医院副院长李平松教授，江苏省医师协会烧伤分会副会长、淮安市第一人民医院互联网医院院长王一兵教授，准安市医学会整形烧伤分会主任委员、准安市第一人民医院杨卫玺教授等专家作专题讲座。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\\\'Calibri\\\',\\\'sans-serif\\\';text-indent:28.0pt;line-height:24.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;<a href=\"/ewebeditor/uploadfile/image/2022/06/27/20220627160341792.jpg\" target=\"_blank\"><img src=\"/ewebeditor/uploadfile/image/2022/06/27/20220627160341792_s.jpg\" border=\"0\" style=\"width: 801px; height: 412px;\"></a><br>\r\n</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\\\'Calibri\\\',\\\'sans-serif\\\';text-indent:28.0pt;line-height:24.0pt\"><span style=\"font-size:14.0pt;font-family:仿宋,仿宋_GB2312\">&nbsp;</span></p>\',\n  ),\n  \'views\' => \'\',\n  \'url\' => \'\',\n  \'model\' => \'article\',\n  \'verified\' => \'\',\n  \'action\' => \'add\',\n  \'id\' => \'\',\n  \'iid\' => \'\',\n  \'attachment_hash\' => \'51ed13245285a3ce\',\n  \'verify\' => 1,\n  \'verifier\' => \'宣传处\',\n  \'attribute\' => \n  array (\n    6 => 6,\n  ),\n)','1656317049');
