INSERT INTO `p8_admin_log` (`id`,`uid`,`system`,`module`,`action`,`iid`,`cid`,`site`,`username`,`title`,`url`,`ip`,`data`,`timestamp`) VALUES ('6427','0','cms','item','add','0','859','','宣传处','添加内容(前台) | 中标结果公示','/index.php/cms/item-list-category-859-page-5','172.16.1.2','array (\n  \'__referer\' => \'http://192.168.162.72/u.php/cms/item-add?model=article\',\n  \'cid\' => \'859\',\n  \'title\' => \'中标结果公示\',\n  \'title_color\' => \'\',\n  \'html\' => \'1\',\n  \'author\' => \'\',\n  \'editer\' => \'\',\n  \'timestamp\' => \'\',\n  \'source\' => \'招标采购中心\',\n  \'keywords\' => \'\',\n  \'frame\' => \'\',\n  \'thumb_width\' => \'328\',\n  \'thumb_height\' => \'247\',\n  \'level_time\' => \'不选则永久有效\',\n  \'level\' => \'\',\n  \'summary\' => \'\',\n  \'sub_title\' => \'\',\n  \'verify_frame\' => \'\',\n  \'custom_a\' => \'\',\n  \'#field_content_posted\' => \'\',\n  \'field#\' => \n  array (\n    \'content\' => \'<p style=\"background: white; margin: 0cm 0cm 0pt; text-align: justify; text-indent: 28pt; font-family: 等线; font-size: 10.5pt; -ms-word-break: break-all; -ms-text-justify: inter-ideograph;\"><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">因医院实际工作需要，于<span>2022</span>年<span>6</span>月<span>28</span>日</span><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">进行招标的项目，经评标委员会评审，中标结果如下：</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 0pt 27.95pt; text-align: justify; font-family: 等线; font-size: 10.5pt; -ms-word-break: break-all; -ms-text-justify: inter-ideograph;\"><span style=\"font-family: 宋体; font-size: 14pt;\">盐城市第一人民医院<span>5</span>月份零星维修项目</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 0pt 27.95pt; text-align: justify; font-family: 等线; font-size: 10.5pt; -ms-word-break: break-all; -ms-text-justify: inter-ideograph;\"><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">中标单位：江苏嘉多宝建设有限公司</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 0pt; text-align: justify; text-indent: 28pt; font-family: 等线; font-size: 10.5pt; -ms-word-break: break-all; -ms-text-justify: inter-ideograph;\"><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">中标价：<span>6.3555</span>万元</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 0pt; text-align: justify; text-indent: 28pt; font-family: 等线; font-size: 10.5pt; -ms-word-break: break-all; -ms-text-justify: inter-ideograph;\"><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">为体现公开、公平、公正的原则，特此公告三天。如有疑问请与盐城市第一人民医院监督审查室联系，</span><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">电话：<span>0515-66696810</span>。</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 0pt; text-align: justify; text-indent: 28pt; font-family: 等线; font-size: 10.5pt; -ms-word-break: break-all; -ms-text-justify: inter-ideograph;\"><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">&nbsp;</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 0pt; text-align: right; text-indent: 28pt; font-family: 等线; font-size: 10.5pt; -ms-word-break: break-all;\"><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">盐城市第一人民医院</span></p>\r\n<p style=\"margin: 0cm 0cm 0pt; text-align: right; font-family: 等线; font-size: 10.5pt;\"><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">&nbsp;2022</span><span style=\"color: black; font-family: 宋体; font-size: 14pt;\">年<span>6</span>月<span>29</span>日</span></p>\',\n  ),\n  \'views\' => \'\',\n  \'url\' => \'\',\n  \'model\' => \'article\',\n  \'verified\' => \'\',\n  \'action\' => \'add\',\n  \'id\' => \'\',\n  \'iid\' => \'\',\n  \'attachment_hash\' => \'4f360be951c3231c\',\n  \'verify\' => 1,\n  \'verifier\' => \'宣传处\',\n)','1656462544');
INSERT INTO `p8_admin_log` (`id`,`uid`,`system`,`module`,`action`,`iid`,`cid`,`site`,`username`,`title`,`url`,`ip`,`data`,`timestamp`) VALUES ('6428','0','cms','item','add','0','859','','宣传处','添加内容(前台) | 盐城市第一人民医院北区电梯维保项目招标公告（三次）','/index.php/cms/item-list-category-859-page-5','172.16.1.2','array (\n  \'__referer\' => \'http://192.168.162.72/u.php/cms/item-add?model=article\',\n  \'cid\' => \'859\',\n  \'title\' => \'盐城市第一人民医院北区电梯维保项目招标公告（三次）\',\n  \'title_color\' => \'\',\n  \'html\' => \'1\',\n  \'author\' => \'\',\n  \'editer\' => \'\',\n  \'timestamp\' => \'\',\n  \'source\' => \'招标采购中心\',\n  \'keywords\' => \'\',\n  \'frame\' => \'\',\n  \'thumb_width\' => \'328\',\n  \'thumb_height\' => \'247\',\n  \'level_time\' => \'不选则永久有效\',\n  \'level\' => \'\',\n  \'summary\' => \'\',\n  \'sub_title\' => \'\',\n  \'verify_frame\' => \'\',\n  \'custom_a\' => \'\',\n  \'#field_content_posted\' => \'\',\n  \'field#\' => \n  array (\n    \'content\' => \'<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">盐城市第一人民医院北区电梯维保项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。</span></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 24pt; text-indent: 24.1pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><b><span style=\"font-family: 宋体; font-size: 12pt;\">1</span></b><b><span style=\"font-family: 宋体; font-size: 12pt;\">、项目概况<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></b></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">1.1</span><span style=\"font-family: 宋体; font-size: 12pt;\">项目名称：盐城市第一人民医院北区电梯维保项目。</span></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">1.2</span><span style=\"font-family: 宋体; font-size: 12pt;\">服务地点：盐城市第一人民医院各院区。</span></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">1.3</span><span style=\"font-family: 宋体; font-size: 12pt;\">招标内容：北区<span>33</span>部、五官科医院<span>3</span>部、广济医院<span>1</span>部电梯维保，电梯参数具体详见项目需求。</span></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">1.4</span><span style=\"font-family: 宋体; font-size: 12pt;\">质量标准：确保招标范围内的电梯安全稳定运行，并通过盐城特检院的定期检验合格。</span></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">1.5 </span><span style=\"font-family: 宋体; font-size: 12pt;\">合同履行期限：叁年，合同按年签订，第一年维保合同结束后，年度考核平均得分≥<span>90</span>分续签下一年维保合同，否则采购人有权终止合同，重新组织招标。具体开始日期以招标人的书面通知为准。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">1.6</span><span style=\"font-family: 宋体; font-size: 12pt;\">招标规模：服务费约<u><span>21 </span></u>万元<span>/</span>年。</span></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 24pt; text-indent: 24.1pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><b><span style=\"font-family: 宋体; font-size: 12pt;\">2 </span></b><b><span style=\"font-family: 宋体; font-size: 12pt;\">投标人应当具备的主要资格条件：</span></b></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">2.1</span><span style=\"font-family: 宋体; font-size: 12pt;\">投标人应具有独立法人资格，能够独立承担民事责任的能力。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">2.2</span><span style=\"font-family: 宋体; font-size: 12pt;\">投标人必须是具有《中华人民共和国特种设备安装改造维修许可证》（许可范围必须包含电梯）且具有<span> B</span>级（含）以上电梯维修<span>(</span>或在<span>2019</span>年<span>6</span>月<span>1</span>日以后新取（换）资质证书电梯安装（含修理）<span>)</span>资质。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">2.3</span><span style=\"font-family: 宋体; font-size: 12pt;\">维保人员均为本单位的正式职工，并确保从投标截止之日当月向前连续<span>6</span>个月均已在本单位缴纳养老保险（例：如开标日期为<span>2022</span>年<span>3</span>月的某一天，则投标单位需保证以上人员<span>2021</span>年<span>9</span>月<span>-2022</span>年<span>2</span>月养老保险均在本单位缴纳）（提供社保证明材料）。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">2.4</span><span style=\"font-family: 宋体; font-size: 12pt;\">投标人投标时须提供配件由电梯原厂供应的承诺原件。<span><br>\r\n&nbsp;&nbsp; 2.5</span>其他要求<span><br>\r\n&nbsp;&nbsp; 2.5.1</span>财务要求：投标人应具有独立订立合同的能力，未处于财产被接管、冻结和破产状态。<span>&nbsp;<br>\r\n&nbsp;&nbsp; 2.5.2</span>信誉要求：①投标人没有被国家、江苏省省级有关部门及盐城市级有关部门暂停招投标或市场准入资格且在公示处罚期内。</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 24pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体; font-size: 12pt;\">2.6</span><span style=\"font-family: 宋体; font-size: 12pt;\">本次招标不接受联合体投标。</span></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 21pt; text-indent: 24.1pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-layout-grid-mode: char; -ms-text-justify: inter-ideograph;\\\'><b><span style=\"font-family: 宋体; font-size: 12pt;\">3</span></b><b><span style=\"font-family: 宋体; font-size: 12pt;\">、投标报名及招标文件的获取</span></b></p>\r\n<p style=\\\'background: white; margin: 0cm 0cm 0pt; line-height: 24pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt;\\\'><span style=\"background: white;\">请符合上述资质条件的投标人携带单位介绍信到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路</span><span style=\"background: white; font-family: 宋体;\">8</span><span style=\"background: white;\">号</span><span style=\"background: white; font-family: 宋体;\">8</span><span style=\"background: white;\">楼</span><span style=\"background: white; font-family: 宋体;\">805</span><span style=\"background: white;\">室）投标报名并领取招标文件，投标报名时间</span><span style=\"background: white; font-family: 宋体;\">2022</span><span style=\"background: white;\">年</span><span style=\"background: white; font-family: 宋体;\">6</span><span style=\"background: white;\">月</span><span style=\"background: white; font-family: 宋体;\">29</span><span style=\"background: white;\">日</span><span style=\"background: white; font-family: 宋体;\">8</span><span style=\"background: white;\">时</span><span style=\"background: white; font-family: 宋体;\">30</span><span style=\"background: white;\">分至</span><span style=\"background: white; font-family: 宋体;\">2022</span><span style=\"background: white;\">年</span><span style=\"background: white; font-family: 宋体;\">7</span><span style=\"background: white;\">月</span><span style=\"background: white; font-family: 宋体;\">4</span><span style=\"background: white;\">日</span><span style=\"background: white; font-family: 宋体;\">18</span><span style=\"background: white;\">时。联系人：刘工，</span><span style=\"background: white; font-family: 宋体;\">0515-69057406</span><span style=\"background: white;\">；手机：</span><span style=\"background: white; font-family: 宋体;\">13626222271</span><span style=\"background: white;\">。</span></p>\r\n<p style=\\\'background: white; margin: 0cm 0cm 0pt; line-height: 24pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt;\\\'><span style=\"background: white; font-family: 宋体;\">4</span><span style=\"background: white;\">、</span><b>本项目采用“资格后审”，“综合评估法”</b><span style=\"background: white;\">。</span></p>\r\n<p style=\\\'background: white; margin: 0cm 0cm 0pt; line-height: 24pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt;\\\'><span style=\"background: white; font-family: 宋体;\">5</span><span style=\"background: white;\">、投标申请人有违反《盐城市市场廉政准则规定（试行）》中规定情形的，招标人将拒绝投标报名。</span></p>\r\n<p style=\\\'background: white; margin: 0cm 0cm 0pt; line-height: 24pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt;\\\'><span style=\"background: white; font-family: 宋体;\">6</span><span style=\"background: white;\">、招投标监督管理机构及投诉电话：盐城市第一人民医院监督审查室，联系电话</span><span style=\"background: white; font-family: 宋体;\">0515-66696810</span><span style=\"background: white;\">。</span></p>\r\n<p style=\\\'margin: 0cm -6pt 0pt 0pt; text-align: justify; line-height: 23pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体;\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\\\'margin: 0cm -6pt 0pt 0pt; text-align: justify; line-height: 23pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体;\">地<span>&nbsp; </span>址：盐城市毓龙西路<span>166</span>号<span>&nbsp;\r\n</span></span></p>\r\n<p style=\\\'margin: 0cm -6pt 0pt 0pt; text-align: justify; line-height: 23pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体;\">联系人：凌工</span></p>\r\n<p style=\\\'margin: 0cm -6pt 0pt 0pt; text-align: justify; line-height: 23pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体;\">电<span>&nbsp; </span>话：<span>0515-83578932</span>　</span></p>\r\n<p style=\\\'margin: 0cm -6pt 0pt 0pt; text-align: justify; line-height: 23pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体;\">&nbsp;</span></p>\r\n<p style=\\\'margin: 0cm -6pt 0pt 0pt; text-align: justify; line-height: 23pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体;\">招标代理机构：江苏仁禾中衡工程咨询房地产估价有限公司\r\n</span></p>\r\n<p style=\\\'margin: 0cm -6pt 0pt 0pt; text-align: justify; line-height: 23pt; text-indent: 24pt; font-family: \"嫤疓B2312\",\"serif\"; font-size: 12pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"font-family: 宋体;\">地址：盐城市青年西路<span>8</span