INSERT INTO `p8_admin_log` (`id`,`uid`,`system`,`module`,`action`,`iid`,`cid`,`site`,`username`,`title`,`url`,`ip`,`data`,`timestamp`) VALUES ('6431','0','cms','item','add','0','879','','宣传处','添加内容 | 献礼七一｜盐城市一院开展大型义诊活动','/index.php/cms/item-list-category-879-page-2','172.16.1.2','array (\n  \'__referer\' => \'http://192.168.162.72/admin.php/cms/item-add?model=article\',\n  \'cid\' => \'879\',\n  \'title\' => \'献礼七一｜盐城市一院开展大型义诊活动\',\n  \'title_color\' => \'\',\n  \'timestamp\' => \'\',\n  \'sub_title\' => \'\',\n  \'author\' => \'\',\n  \'source\' => \'盐城市第一人民医院\',\n  \'level_time\' => \'不选则永久有效\',\n  \'level\' => \'\',\n  \'keywords\' => \'\',\n  \'frame\' => \'\',\n  \'thumb_width\' => \'328\',\n  \'thumb_height\' => \'247\',\n  \'summary\' => \'\',\n  \'addon_title\' => \'\',\n  \'url\' => \'\',\n  \'verify_frame\' => \'\',\n  \'#field_content_posted\' => \'\',\n  \'field#\' => \n  array (\n    \'content\' => \'<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\\\'Calibri\\\',\\\'sans-serif\\\';text-indent:28.0pt\"><span style=\"font-size:14.0pt;\r\nfont-family:仿宋,仿宋_GB2312\">为庆祝中国共产党成立<span>101</span>周年，喜迎党的“二十大”胜利召开，<span>7</span>月<span>1</span>日，盐城市第一人民医院在南院区门诊大厅开展义诊活动。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\\\'Calibri\\\',\\\'sans-serif\\\';text-indent:28.0pt\"><span style=\"font-size:14.0pt;\r\nfont-family:仿宋,仿宋_GB2312\">此次义诊活动由普通外科、骨科、心胸外科、神经内科、心血管内科、呼吸与危重症医学科、消化内科、内分泌科、妇科、中医科等科室的党员专家向广大群众提供免费的诊疗服务和健康咨询。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\\\'Calibri\\\',\\\'sans-serif\\\';text-indent:28.0pt\"><span style=\"font-size:14.0pt;\r\nfont-family:仿宋,仿宋_GB2312\">&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;<a href=\"/