INSERT INTO `p8_admin_log` (`id`,`uid`,`system`,`module`,`action`,`iid`,`cid`,`site`,`username`,`title`,`url`,`ip`,`data`,`timestamp`) VALUES ('6456','0','cms','item','add','0','859','','宣传处','添加内容(前台) | 中标结果公示','/index.php/cms/item-list-category-859-page-5','172.16.1.2','array (\n  \'__referer\' => \'http://192.168.162.72/u.php/cms/item-add?model=article\',\n  \'cid\' => \'859\',\n  \'title\' => \'中标结果公示\',\n  \'title_color\' => \'\',\n  \'html\' => \'1\',\n  \'author\' => \'\',\n  \'editer\' => \'\',\n  \'timestamp\' => \'\',\n  \'source\' => \'招标采购中心\',\n  \'keywords\' => \'\',\n  \'frame\' => \'\',\n  \'thumb_width\' => \'328\',\n  \'thumb_height\' => \'247\',\n  \'level_time\' => \'不选则永久有效\',\n  \'level\' => \'\',\n  \'summary\' => \'\',\n  \'sub_title\' => \'\',\n  \'verify_frame\' => \'\',\n  \'custom_a\' => \'\',\n  \'#field_content_posted\' => \'\',\n  \'field#\' => \n  array (\n    \'content\' => \'<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">因医院实际工作需要，于<span>2022</span>年<span>7</span>月<span>5</span>日进行招标的项目，经评标小组评审，中标结果如下：</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">一、盐城市第一人民医院北区手术室更衣柜采购安装项目</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">中标单位：苏州璟科金属科技有限公司</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">中标价：<span>146740.00</span>元</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">二、盐城市第一人民医院北区妇产科门诊改造工程</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">中标单位：江苏亮辉建设工程有限公司</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">中标价：<span>505559.30</span>元</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">项目负责人：王盛军</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">三、盐城市第一人民医院北区手术室更衣区改造工程</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">中标单位：江苏嘉多宝建设有限公司</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">中标价：<span>501514.84</span>元</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; line-height: 23pt; text-indent: 28pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-autospace:; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">项目负责人：韦加志</span></p>\r\n<p align=\"left\" style=\\\'margin: 0cm 0cm 0pt; text-align: left; line-height: 27.75pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">为体现公开、公平、公正的原则，特此公告三天。如有疑问请与盐城市第一人民医院监督审查室联系，电话<span>0515-66696810</span>。</span></p>\r\n<p style=\\\'margin: 0cm 56pt 0pt 0cm; text-align: justify; line-height: 21pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">&nbsp;</span></p>\r\n<p align=\"right\" style=\\\'margin: 0cm 0cm 0pt; text-align: right; line-height: 21pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">盐城市第一人民医院</span></p>\r\n<p align=\"right\" style=\\\'margin: 0cm 0cm 0pt; text-align: right; line-height: 21pt; text-indent: 24pt; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;2022</span><span style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14pt;\">年<span>7</span>月<span>6</span>日</span></p>\r\n<p style=\\\'margin: 0cm 0cm 0pt; text-align: justify; font-family: \"Times New Roman\",\"serif\"; font-size: 10.5pt; -ms-text-justify: inter-ideograph;\\\'><span>&nbsp;</span></p>\',\n  ),\n  \'views\' => \'\',\n  \'url\' => \'\',\n  \'model\' => \'article\',\n  \'verified\' => \'\',\n  \'action\' => \'add\',\n  \'id\' => \'\',\n  \'iid\' => \'\',\n  \'attachment_hash\' => \'4c0e111452f0c41d\',\n  \'verify\' => 1,\n  \'verifier\' => \'宣传处\',\n)','1657068391');
