INSERT INTO `p8_admin_log` (`id`,`uid`,`system`,`module`,`action`,`iid`,`cid`,`site`,`username`,`title`,`url`,`ip`,`data`,`timestamp`) VALUES ('6477','0','cms','item','update','1993','936','','宣传处','修改内容 | 王志华','/index.php/cms/item-list-category-936-page-1','172.16.1.2','array (\n  \'__referer\' => \'http://192.168.162.72/admin.php/cms/item-update?model=article&id=1993&verified=1\',\n  \'cid\' => \'936\',\n  \'title\' => \'王志华\',\n  \'title_color\' => \'\',\n  \'timestamp\' => \'2021-07-13 16:03:17\',\n  \'sub_title\' => \'主任医师\',\n  \'author\' => \'\',\n  \'source\' => \'\',\n  \'attribute\' => \n  array (\n    6 => 6,\n  ),\n  \'level_time\' => \'不选则永久有效\',\n  \'level\' => \'\',\n  \'keywords\' => \'\',\n  \'frame\' => \'http://www.ycsyy.com/attachment/cms/item/2021_07/13_16/18e721bea65c64e0.JPG\',\n  \'thumb_width\' => \'328\',\n  \'thumb_height\' => \'247\',\n  \'summary\' => \'王志华，医学博士，主任医师，心血管内科副主任。\',\n  \'addon_title\' => \'\',\n  \'url\' => \'\',\n  \'verify_frame\' => \'\',\n  \'#field_content_posted\' => \'\',\n  \'field#\' => \n  array (\n    \'content\' => \'<span style=\"font-family: 宋体; font-size: 12pt;\">王志华，医学博士，主任医师，心血管内科副主任，毕业于上海交通大学医学院，江苏省医师学会心脏重症委员会委员，江苏省医学会心血管分会心力衰竭学组委员，江苏省预防学会心血管分会委员。曾先后上海交通大学附属仁济医院、北京阜外医院、南京鼓楼医院和上海胸痛进修心血管介入。擅长复杂冠脉病变（慢性闭塞病变和钙化病变旋磨术）的介入治疗、起搏器植入手术（左束支起搏、</span><span style=\"font-size: 12pt;\">ICD</span><span style=\"font-family: 宋体; font-size: 12pt;\">植入和</span><span style=\"font-size: 12pt;\">CRT</span><span style=\"font-family: 宋体; font-size: 12pt;\">植入）和左心耳封堵术。获得盐城市科技进步二等奖两项。以第一作者发表论文</span><span style=\"font-size: 12pt;\">9</span><span style=\"font-family: 宋体; font-size: 12pt;\">篇，其中</span><span style=\"font-size: 12pt;\">SCI</span><span style=\"font-family: 宋体; font-size: 12pt;\">文章</span><span style=\"font-size: 12pt;\">3</span><span style=\"font-family: 宋体; font-size: 12pt;\">篇。</span><br>\r\n<br>\',\n  ),\n  \'editer\' => \'\',\n  \'list_order\' => \'2021-07-13 16:03:17\',\n  \'views\' => 2,\n  \'verify\' => 1,\n  \'html\' => \'1\',\n  \'html_view_url_rule\' => \'\',\n  \'seo_keywords\' => \'\',\n  \'seo_description\' => \'\',\n  \'template\' => \'\',\n  \'config\' => \n  array (\n    \'allow_ip\' => \n    array (\n      \'enabled\' => \'0\',\n      \'collectip\' => \'\',\n      \'area_ip\' => \'\',\n      \'ruleoutip\' => \'\',\n    ),\n  ),\n  \'custom_a\' => \'擅长复杂冠脉病变（慢性闭塞病变和钙化病变旋磨术）的介入治疗、起搏器植入手术（左束支起搏、ICD植入和CRT植入）和左心耳封堵术。\',\n  \'model\' => \'article\',\n  \'verified\' => \'1\',\n  \'id\' => \'1993\',\n  \'iid\' => \'1993\',\n  \'page\' => \'1\',\n  \'_referer\' => \'http://192.168.162.72/admin.php/cms/item-list\',\n  \'credit_type\' => \'0\',\n  \'credit\' => \'1\',\n  \'action\' => \'update\',\n  \'attachment_hash\' => \'4e959af25020a1a8\',\n  \'verifier\' => \'admin5\',\n)','1658110307');
